import React from "react";
const News = ({title}) => {
    return(
        <div className="container text-light">
            <div className="cards pt-4">
                <h3>{title}</h3>
                <p>Description</p>
                <img src="" alt="" />
            </div>
        </div>
    );
}

export default News;
